    false,nt"url": null,nt"notes": "Delineations, also know as capture zones,
    were created as part of the State of Idaho Source Water Protection program. The
    delineations can be classified as one of two categories: fixed radius and modeled.
    Transient and surface water systems were delineated with the fixed radius method.
    The remaining systems were delineated utilizing groundwater modeling. Most delineations
    are structured as three polygons depicting 3-, 6-, & 10-year time of travel zone.",nt"license_title":
